import React from 'react';
import {
  StyleSheet,
  Text,
  View,
  SafeAreaView,
  Button,
  ImageBackground,
  Platform,
} from 'react-native';

const WelcomeScreen = () => {
  return (
    <View style={styles.container}>
      <Button title='Login' color='dodgerblue' />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'orange',
  },
});

export default WelcomeScreen;
